CREATE HADOOP TABLE IF NOT EXISTS SLS_PRODUCT_DIM
(
PRODUCT_KEY             int,
PRODUCT_LINE_CODE       int,
PRODUCT_TYPE_KEY        int,
PRODUCT_TYPE_CODE       int,
PRODUCT_NUMBER          int,
BASE_PRODUCT_KEY        int,
BASE_PRODUCT_NUMBER     int,
PRODUCT_COLOR_CODE          int,
PRODUCT_SIZE_CODE          int,
PRODUCT_BRAND_KEY          int,
PRODUCT_BRAND_CODE          int,
PRODUCT_IMAGE          varchar(120)
)
ROW FORMAT DELIMITED FIELDS TERMINATED BY '\T';


CREATE HADOOP TABLE IF NOT EXISTS SLS_ORDER_METHOD_DIM ( ORDER_METHOD_KEY int, ORDER_METHOD_CODE int, ORDER_METHOD_EN varchar(180), ORDER_METHOD_DE varchar(180), ORDER_METHOD_FR varchar(180), ORDER_METHOD_JA varchar(180), ORDER_METHOD_CS varchar(180), ORDER_METHOD_DA varchar(180), ORDER_METHOD_EL varchar(180), ORDER_METHOD_ES varchar(180), ORDER_METHOD_FI varchar(180), ORDER_METHOD_HU varchar(180), ORDER_METHOD_ID varchar(180), ORDER_METHOD_IT varchar(180), ORDER_METHOD_KO varchar(180), ORDER_METHOD_MS varchar(180), ORDER_METHOD_NL varchar(180), ORDER_METHOD_NO varchar(180), ORDER_METHOD_PL varchar(180), ORDER_METHOD_PT varchar(180), ORDER_METHOD_RU varchar(180), ORDER_METHOD_SC varchar(180), ORDER_METHOD_SV varchar(180), ORDER_METHOD_TC varchar(180), ORDER_METHOD_TH varchar(180) ) ROW FORMAT DELIMITED FIELDS TERMINATED BY '\t';
CREATE HADOOP TABLE IF NOT EXISTS SLS_SALES_FACT ( ORDER_DAY_KEY int, ORGANIZATION_KEY int, EMPLOYEE_KEY int, RETAILER_KEY int, RETAILER_SITE_KEY int, PRODUCT_KEY int, PROMOTION_KEY int, ORDER_METHOD_KEY int, SALES_ORDER_KEY int, SHIP_DAY_KEY int, CLOSE_DAY_KEY int, QUANTITY int, UNIT_COST decimal(19,2), UNIT_PRICE decimal(19,2), UNIT_SALE_PRICE decimal(19,2), GROSS_MARGIN double, SALE_TOTAL decimal(19,2), GROSS_PROFIT decimal(19,2) ) ROW FORMAT DELIMITED FIELDS TERMINATED BY '\t';










<BS>select 
ORGANIZATION_KEY
, EMPLOYEE_KEY
, RETAILER_KEY
, RETAILER_SITE_KEY
, PRODUCT_KEY
, PROMOTION_KEY
FROM SLS_SALES_FACT;

select 
f.order_method_key
, f.quantity
, f.unit_cost
, f.unit_price
, f.PRODUCT_KEY
, f.unit_sale_price
, f.gross_margin
, f.sale_total
, f.gross_profit
, d.product_type_key
, d.product_color_code
, d.product_size_code
FROM SLS_SALES_FACT as f
left join sls_product_dim as d on f.product_key = d.product_key;



create view sales
as
select sls_sales_fact.product_key
, product_type_key
, product_color_code
, product_size_code
, quantity
, unit_cost
, unit_price
, unit_sale_price
, gross_margin
, sale_total
, gross_profit
, order_method_en
from sls_product_dim, sls_sales_fact, sls_order_method_dim
where
sls_product_dim.product_key = 
sls_sales_fact.product_key
and
sls_sales_fact.order_method_key =
sls_order_method_dim.order_method_key
;

select sum(gross_profit) grandProfit
from sales
group_by order_method_en
;

select order_method_en, sum(gross_profit) OrderMethodProfit
from sales
group_by order_method_en
;


select order_method_en, sum(gross_profit) OrderMethodProfit
from sales
group by order_method_en
having sum(gross_profit) > 20000
;
select product_color_code, avg(gross_profit) ProdSizeProfit
from sales
group by product_color_code
order by 2 desc
;

select order_method_en, product_type_key, avg(gross_profit) OrderMethodProfit
from sales
group by order_method_en, product_type_key
;

select order_method_en, sum(gross_profit) OrderMethodProfit
from sales
group by rollup(order_method_en)
;


select order_method_en
, sum(gross_profit) OrderMethodProfit
, sum(quantity) number_sold
from sales
group by rollup(order_method_en)
order by order_method_en nulls last
;


